// src/components/ColumnaDerecha.jsx
import React from 'react';
import Viewer from './Viewer';

const ColumnaDerecha = ({ isCollapsed, token, urn, selectedIds, onCameraChange, onSelectionChange, refViewer }) => {
    return (
        <div style={{ width: isCollapsed ? 'calc(100% - 50px)' : 'calc(100% - 250px)', backgroundColor: '#fff' }}>
            <div style={{ position: 'relative', width: '100%', height: '600px' }}>
                <Viewer
                    runtime={{ accessToken: token }}
                    urn={urn}
                    selectedIds={selectedIds}
                    onCameraChange={onCameraChange}
                    onSelectionChange={onSelectionChange}
                    ref={refViewer}
                />
            </div>
            {/* Otro contenido de ColumnaDerecha aqu√≠ si es necesario */}
        </div>
    );
};

export default ColumnaDerecha;
